  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2008 (NAEP 2008), is a study that is part of the National Assessment of Educational
  Progress (NAEP) program; program data is available since 1990 at http://nces.ed.gov/nationsreportcard/naepdata/.
  NAEP 2008 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
  assesses what America's students know and can do in arts. The study was conducted
  using computer-based assessment of students. Students in grade 8 were sampled. Key
  statistics produced from NAEP 2008 are results on subject-matter achievement, instructional
  experiences, and school environment for populations of students (e.g., all eighth-graders)
  and groups within those populations (e.g., female students, Hispanic students).\",\n\t\"license_title\":
